import React, { useEffect, useState, useContext } from "react";
import $ from "jquery";
import { Link } from "react-router-dom";
import MuiAlert from '@material-ui/lab/Alert';
import { makeStyles } from "@material-ui/core/styles";
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import CancelIcon from '@material-ui/icons/Cancel';
import Backdrop from '@material-ui/core/Backdrop';
import CircularProgress from '@material-ui/core/CircularProgress';
import Snackbar from '@material-ui/core/Snackbar';
import Skeleton from '@material-ui/lab/Skeleton';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import video from "../../images/video.mp4";
import Footer from "../../components/Footer/Footer";
import logo from "../../images/vtc-logo.png";
import mission_bg from "../../images/mission-bg.jpg";
import phone from "../../images/phone.png";
import ftr_head from "../../images/ftr-head-bg.png";
import pic_bg from "../../images/pic-bg.png";
import video_1 from "../../images/video3.mp4";
import user from "../../images/user.jpg";
import { APIURL, APIPath } from "../../CommonMethods/Fetch";
import { postRecord } from "../../CommonMethods/Save";
import { AuthContext } from "../../CommonMethods/Authentication";
import Footer1 from "../../components/Footer/Footer1";
const APIGetSiteSetting = APIURL() + "sitesetting";
const APIGetUserData = APIURL() + "user-details";
const APIHomeData = APIURL() + "homecontent";
const APIPartnerData = APIURL() + "company-logoList";
const APIGetBrokerDetails = APIURL() + "get-BrokerDetails";
const APIVisitorOption = APIURL() + "visitor-opt-newsletter";

function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const options = {
    lazyLoad: true,
    loop: true,
    margin: 0,
    responsiveClass: true,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    autoplay: true,
    autoplayTimeout: 3500,
    autoplayHoverPause: false,
    autoHeight: true,
    mouseDrag: true,
    touchDrag: true,
    smartSpeed: 1000,
    nav: true,
    navText: ["<i class='fa fa-angle-left sp'></i>", "<i class='fa fa-angle-right sp'></i>"],
    dots: false,
    responsive: {
        0: {
            items: 1
        },

        600: {
            items: 1
        },

        1024: {
            items: 1
        },

        1366: {
            items: 1
        }
    }
};
const options1 = {
    lazyLoad: true,
    loop: true,
    margin: 20,
    responsiveClass: true,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    autoplay: true,
    autoplayTimeout: 3500,
    autoplayHoverPause: false,
    autoHeight: true,
    mouseDrag: true,
    touchDrag: true,
    smartSpeed: 2500,
    nav: false,
    dots: false,
    responsive: {
        0: {
            items: 1
        },

        600: {
            items: 2
        },

        1024: {
            items: 4
        },

        1366: {
            items: 5
        }
    }
};
const options2 = {
    lazyLoad: true,
    loop: true,
    margin: 20,
    responsiveClass: true,
    animateOut: 'fadeOut',
    animateIn: 'fadeIn',
    autoplay: true,
    autoplayTimeout: 3500,
    autoplayHoverPause: false,
    autoHeight: true,
    mouseDrag: true,
    touchDrag: true,
    smartSpeed: 2500,
    nav: false,
    dots: true,
    responsive: {
        0: {
            items: 1
        },

        600: {
            items: 1
        },

        1024: {
            items: 1
        },

        1366: {
            items: 1
        }
    }
};
const useStyles = makeStyles((theme) => ({
    recent_projects_head: {
        position: "relative",
        textAlign: "center",
        '& h2::after': {
            backgroundImage: "url(" + ftr_head + ")",
            content: '""',
            height: "4px",
            width: "50px",
            position: "absolute",
            textAlign: "center",
            right: "0",
            left: "0",
            bottom: "-20px",
            margin: "0 auto"
        },
        '& p': {
            color: "#353535",
            maxWidth: "1100px",
            margin: "0 auto",
            fontSize: " 18px",
            fontWeight: "600",
            lineHeight: "26px"
        },
        '& h2': {
            color: "#212d3e",
            margin: "0 0 45px 0",
            fontWeight: "600",
            fontFamily: 'Jost',
            position: "relative",
            textAlign: "center"
        },
    },
    photo_sec_main_single: {
        position: "relative"
    },
    photo_sec_main_single_cont: {
        position: "relative",
        margin: "15px 0 0 0",
        textAlign: "center",
        '& h4': {
            position: "relative",
            fontFamily: 'Jost',
            fontSize: "30px",
            fontWeight: "600",
            color: "#000",
            margin: "0 0 20px 0"
        },
        '& p': {
            fontWeight: "600",
        },
    },
    photo_sec_main_single_img: {
        position: "relative",
        textAlign: "center",
        minHeight: "115px",
        '& ::after': {
            backgroundImage: "url(" + pic_bg + ")",
            backgroundSize: "cover",
            backgroundPosition: "center center",
            content: '""',
            height: "115px",
            width: "170px",
            position: "absolute",
            textAlign: "center",
            right: "0",
            left: "0",
            margin: "0 auto",
            top: "-100px",
            zIndex: "-1",
        },
    },
    our_partners_head: {
        position: "relative",
        textAlign: "center",
        '& h2::after': {
            backgroundImage: "url(" + ftr_head + ")",
            content: '""',
            height: "4px",
            width: "50px",
            position: "absolute",
            textAlign: "center",
            right: "0",
